import React, { Component } from 'react';

class DurationFilter extends Component {
  constructor(props) {
      super();
      this.state = {
          durationSet: false
      }
  }
  render() {
      return (
          <button className="btn">Duration</button>
      )
  }
}

export default DurationFilter;
